import React from 'react';
import { useHistory } from 'react-router-dom';

const AboutButton = () => {
  const history = useHistory();

  const handleClick = () => {
    history.push('/about');
  };

  return (
    <button className='btns btn--outline btn--large' onClick={handleClick}>
      ABOUT US
    </button>
  );
};

export default AboutButton;
